package info.nukoneko.android.ho_n.sys.eventbus.event;import info.nukoneko.android.ho_n.sys.eventbus.NKEventTwitter;import twitter4j.User;import twitter4j.UserList;/** * Created by TEJNEK on 2016/10/22. */public class OnStreamUserListCreation extends NKEventTwitter {    private final User listOwner;    private final UserList list;    public OnStreamUserListCreation(long managingUserId, User listOwner, UserList list) {        super(managingUserId);        this.listOwner = listOwner;        this.list = list;    }    public UserList getList() {        return list;    }    public User getListOwner() {        return listOwner;    }}